  "terms and conditions": "The project seeks to offer complete, authoritative data relative to each composition and to demonstrate the totality of the genre. The site allows for, and welcomes, comments, verifiable corrections, and appropriate ancillary information that may help illuminate a better understanding of an individual work or the entirety of the repertoire. The project welcomes input from composers who have written for the genre, or would like to, and will share those thoughts, observations and comments within the catalog entries. Additionally, the project seeks comments and observations from musicians who have performed, premiered or recorded works in this catalog as well as from listeners, concert goers or from anyone who shares the passion of chamber music and the genre of the clarinet quintet."
